import { Component, OnInit } from '@angular/core';
import { FormGroup, FormControl, Validators } from '@angular/forms';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent implements OnInit {
  group: FormGroup;

  ngOnInit() {
    this.group = new FormGroup({
      nombrePaciente: new FormControl(null, Validators.required),
      apellidoPaciente: new FormControl(null, Validators.required),
      dni: new FormControl(null, [
        Validators.required,
        Validators.pattern('[0-9]{8,8}'),
      ]),
      edad: new FormControl(null, [
        Validators.required,
        Validators.pattern('[0-9]{1,2}'),
      ]),
      nombreMedico: new FormControl(null, Validators.required),
      apellidoMedico: new FormControl(null, Validators.required),
      diagnostico01: new FormControl(null, Validators.required),
      diagnostico02: new FormControl(null, Validators.required),
      diagnostico03: new FormControl(null, Validators.required),
    });
  }

  actionPDF(action = 'open') {
    //if (this.group.valid) {
    const content = this.getInformation();
    switch (action) {
      case 'open':
        pdfMake.createPdf(content).open();
        break;
      case 'download':
        pdfMake.createPdf(content).download();
        break;
      case 'print':
        pdfMake.createPdf(content).print();
        break;
    }
    //}
  }

  getInformation() {
    const testImageDataUrl =
      // tslint:disable-next-line: max-line-length
      'data:image/jpeg;base64,';

    return {
      content: [
        {
          text: 'Historia Médica',
          bold: true,
          fontSize: 20,
          alignment: 'center',
          margin: [0, 0, 0, 20],
        },
        {
          columns: [
            [
              {
                text: 'Datos del paciente',
                style: 'header',
              },
              {
                text: `Nombre: ${this.group.value.nombrePaciente}`,
              },
              {
                text: `Apellido: ${this.group.value.apellidoPaciente}`,
              },
              {
                text: `DNI: ${this.group.value.dni}`,
              },
              {
                text: `Edad: ${this.group.value.edad} años`,
              },
            ],
            [
              {
                text: 'Datos del médico',
                style: 'header',
              },
              {
                text: `Nombre: ${this.group.value.nombreMedico}`,
              },
              {
                text: `Apellido: ${this.group.value.apellidoMedico}`,
              },
            ],
          ],
        },

        {
          text: 'Diagnósticos',
          style: 'header',
        },
        {
          columns: [
            [
              {
                text: 'Diagnóstico 01',
              },
              { text: this.group.value.diagnostico01 },
            ],
            [
              {
                text: 'Diagnóstico 02',
              },
              { text: this.group.value.diagnostico02 },
            ],
            [
              {
                text: 'Diagnóstico 03',
              },
              { text: this.group.value.diagnostico03 },
            ],
          ],
        },
        {
          text: 'Diagnóticos como tabla',
          style: 'header',
        },
        {
          style: 'tableOpacity',
          table: {
            widths: [200, '*', 200],
            body: [
              ['Diagnóstico 01', 'Diagnóstico 02', 'Diagnóstico 03'],
              [
                this.group.value.diagnostico01,
                this.group.value.diagnostico02,
                this.group.value.diagnostico03,
              ],
            ],
          },
        },
        {
          image: testImageDataUrl,
          width: 200,
        },
      ],
      styles: {
        header: {
          fontSize: 16,
          bold: true,
          margin: [0, 20, 0, 10],
          decoration: 'underline',
        },
        tableOpacity: {
          margin: [0, 5, 0, 15],
          fillColor: 'blue',
          fillOpacity: 0.3,
        },
      },
    };
  }
}
